subSubSection.paragraph:
Male terminalia.
Apex of ventral lobe narrowly emarginate and apex of dorsal lobe pointed; dorsal lobe shorter than ventral lobe; spined region of internal sac 3.45–4.04 × as long as basal unspined region; spined region divided into 2 sections with unspined gap between sections: first section bearing dense long simple spines, with fairly dense multi-branched spines near sides; second section with sparse simple spines (
Fig. 58a
). Eighth sternite strongly obliquely truncate at side, shallowly emarginate at apex, with long and fairly long setae arising terminally; ventral side with very sparse multi-branched spines and fairly dense cloud-like processes (
Fig. 58b
). Eighth tergite rounded at apex, with fairly dense short simple spines and multi-branched spines on dorsal surface (
Fig. 58c
). Paramere short, 1.46–1.53 x as long as wide, cylindrical in shape; apex rounded with long and short setae (
Fig. 58d
).

Ovipositor and spermatheca.
Ovipositor short; styli arising terminally with short hairs (
Fig. 58e
). Spermatheca clearly curved; spermathecal gland long and arising near base of spermatheca (
Fig. 58f
).
